import React from "react";
import s from './CoinBlock.module.css'

const CoinBlock = (props) => {
  //debugger
  return (
    <div className={s.coinBlock}>
      <div>
        <img src={props.img} />
      </div>
      <div>
        <div>{props.name}</div>
      </div>
      <div>
        <div>Price: ${(+props.price).toFixed(2)}</div>
      </div>
      <div>
        <div>Price change: {(+props.price_change_prc * 100).toFixed(2)}%</div>
      </div>
      <div>
        Market cap:
        {props.market_cap.length >= 13
          ? " $" + +(props.market_cap / 1000000000000).toFixed(2) + "T"
          : true}
        {props.market_cap.length < 13
          ? " $" + +(props.market_cap / 1000000000).toFixed(2) + "B"
          : true}
      </div>
      <div>
        <div>{props.name}</div>
      </div>
    </div>
  );
};

export default CoinBlock;
